import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top: 23px;
`;

const TableHead = styled.div`
  width: 1072px;
  height: 54px;
  padding: 16px 60px 16px 32px;
  border-radius: 3px;
  background-color: #fafafa;
`;

const ThContainer = styled.div`
  margin: 0 30px;
`;

const table = [
  { title: "Date/Time" },
  { title: "Name" },
  { title: "Device" },
  { title: "Payment" },
  { title: "BIN Number" },
  { title: "Amount" },
  { title: "Trans ID" },
  { title: "Decision" },
];
const TransactionLog = () => {
  return (
    <Container>
      <TableHead>
        {table.map((title) => {
          return (
            <tr>
              <ThContainer>
                <th>Date/Time</th>
              </ThContainer>
            </tr>
          );
        })}
      </TableHead>
      <tr>
        <td>Alfreds Futterkiste</td>
        <td>Maria Anders</td>
        <td>Germany</td>
      </tr>
    </Container>
  );
};

export default TransactionLog;
